package com.company;import java.math.BigInteger;import java.util.Scanner;public class MultiplayBigNumber_05 {    public static void main(String[] args) {        Scanner scanner = new Scanner(System.in);        BigInteger number1 = new BigInteger(scanner.nextLine());        BigInteger number2= new BigInteger(scanner.nextLine());         number1 = number1.multiply(number2);        System.out.println(number1);    }}